import React from "react";
import { Link } from "react-router-dom";
import "./Header.scss";
import CoinModal from "../CoinModal/CoinModal";

function Header() {
  return (
    <div className="header">
      <ul className="header__link">
        <Link to="/">
          <button className="header__link--one">Home</button>
        </Link>
        <CoinModal />
        <Link to="/virtualWallet">
          <button className="header__link--three">
            How Virtual Wallet Works
          </button>
        </Link>
        <h1>Click Button to TOSS!!</h1>
        <div class="outerbox">
          <div class="coin">
            <div class="head">H</div>
            <div class="tail">T</div>
          </div>
        </div>
        <button>Toss</button>
      </ul>
    </div>
  );
}

export default Header;
